import React from 'react';
import './style.css';
import ReactDOM from 'react-dom';

class Brand extends React.Component {
    constructor() {
        super();
        this.state = {
            displayMenu: false,
            displayStyle: false,
            brand: "",
            titleDisplay: true,
            fixedBlade: false,
            slipJoint: false,
            flipper: false,
            automatic: false,
            assisted: false,
            thumbStud: false,
        };

        this.showDropdownMenu = this.showDropdownMenu.bind(this);
        this.hideDropdownMenu = this.hideDropdownMenu.bind(this);
        this.showDisplayBrand1 = this.showDisplayBrand1.bind(this);
        this.showDisplayBrand2 = this.showDisplayBrand2.bind(this);
        this.showDisplayBrand3 = this.showDisplayBrand3.bind(this);
        this.showDisplayBrand4 = this.showDisplayBrand4.bind(this);
        this.showDisplayBrand5 = this.showDisplayBrand5.bind(this);
        this.showDisplayBrand6 = this.showDisplayBrand6.bind(this);
    };

    showDropdownMenu(event) {
        event.preventDefault();
        this.setState({ displayMenu: true }, () => {
            document.addEventListener('click', this.hideDropdownMenu);
        });
    }

    showDisplayBrand1(event) {
        event.preventDefault();
        this.setState({ displayBrand: true, Brand: "Fixed Blade", titleDisplay: false, fixedBlade: true }, () => {
            document.addEventListener('click', this.hideDropdownMenu);
        });
    }
    showDisplayBrand2(event) {
        event.preventDefault();
        this.setState({ displayBrand: true, Brand: "Slip Joint", titleDisplay: false, slipJoint: true }, () => {
            document.addEventListener('click', this.hideDropdownMenu);
        });
    }
    showDisplayBrand3(event) {
        event.preventDefault();
        this.setState({ displayBrand: true, Brand: "Flipper", titleDisplay: false, flipper: true }, () => {
            document.addEventListener('click', this.hideDropdownMenu);
        });
    }
    showDisplayBrand4(event) {
        event.preventDefault();
        this.setState({ displayBrand: true, Brand: "Automatic", titleDisplay: false, automatic: true }, () => {
            document.addEventListener('click', this.hideDropdownMenu);
        });
    }
    showDisplayBrand5(event) {
        event.preventDefault();
        this.setState({ displayBrand: true, Brand: "Assisted", titleDisplay: false, assisted: true }, () => {
            document.addEventListener('click', this.hideDropdownMenu);
        });
    }
    showDisplayBrand6(event) {
        event.preventDefault();
        this.setState({ displayBrand: true, Brand: "Thumb Stud", titleDisplay: false, thumbStud: true }, () => {
            document.addEventListener('click', this.hideDropdownMenu);
        });
    }

    hideDropdownMenu() {
        this.setState({ displayMenu: false }, () => {
            document.removeEventListener('click', this.hideDropdownMenu);
        });
    }



    render() {
        return (

            <div className="dropdown">
                {this.state.titleDisplay ? (
                    <div className='dropdownStylingTitle' onClick={this.showDropdownMenu}>Select Knife Brand</div>
                ) :
                    (
                        null
                    )
                }

                {this.state.displayMenu ? (
                    <div className='dropStyling help1'>
                        <ul>
                            <li className='knifeBrandDropdown dropdownStyling' onClick={this.showDisplayBrand1}>Fixed Blade</li>
                            <li className='knifeBrandDropdown dropdownStyling' onClick={this.showDisplayBrand2}>Slip Joint</li>
                            <li className='knifeBrandDropdown dropdownStyling' onClick={this.showDisplayBrand3}>Flipper</li>
                            <li className='knifeBrandDropdown dropdownStyling' onClick={this.showDisplayBrand4}>Automatic</li>
                            <li className='knifeBrandDropdown dropdownStyling' onClick={this.showDisplayBrand5}>Assisted</li>
                            <li className='knifeBrandDropdown dropdownStyling' onClick={this.showDisplayBrand6}>Thumb Stud</li>
                        </ul>
                    </div>
                ) :
                    (
                        null
                    )
                }
                {this.state.displayStyle ? (
                    <div>
                        <div className='styleStyling dropdownStylingTitle'>{this.state.brand}</div>
                    </div>
                ) :
                    (
                        null
                    )
                }
            </div>
        );
    }
}

// ReactDOM.render(displayDropdown, document.getElementById('root'));
export default Brand;
